import React from "react";
import { Link } from "react-router-dom";
import curso from "../data/Pruebas";

const Nosotros = ()=>{
    return(
        <div>
            <ul>
                {
                    curso.map(iten=>(
                        <li key={iten.id}>
                            <Link> 
                                {iten.titulo}
                            </Link>
                        </li>
                    ))
                }
            </ul>
        </div>

    )

}

export default Nosotros;
